import React, { useEffect } from "react";


export const Google_Map = () => {

    useEffect(()=>{
        const script = document.createElement("script");

        script.src = "https://maps.googleapis.com/maps/api/js?key=AIzaSyBw0X4pec-WCEWCcNz-tmNDEqo9XiZyNdM&loading=async&libraries=maps&callback=initMap";
        script.async = true;
    
        document.body.appendChild(script);
        

    })

return <React.Fragment>

<div id='Google_Map'>
</div>

</React.Fragment>

}

export default Google_Map
